var fire = {} || window.fire;

//inner function
fire.loadFile = function (ext) {
  var fId = ext+"-file";
  var fread = new FileReader();
  switch (ext) {
    case "ma":
      var f = new File(fire.MA,"fire."+ext);
      fread.readAsText(f);
      fread.onloadend = function(){
    		inp.file[fId] = fread.result;
        console.log("DEMO FIRE MA loaded");
        grid.model.name = f.name.slice(0, f.name.lastIndexOf('.'));
        //start loading the .pal file after .ma is done loading
        fire.loadFile("pal");
      }
      break;
    case "pal":
      var f = new File(fire.PAL,"fire."+ext);
      fread.readAsText(f);
      fread.onloadend = function(){
    		inp.file[fId] = fread.result;
        console.log("DEMO FIRE PAL loaded");
        //start loading the .val file after .pal is done loading
        fire.loadFile("val");
      }
      break;
    case "log":
      var f = new File(fire.LOG,"fire."+ext);
      inp.logFile = f;
			inp.logLoaded = true;
      console.log("DEMO FIRE LOG ready for parse");
      //load the simulation after all files are loaded
      grid.loadSimulation();
      break;
    case "val":
        var f = new File(fire.VAL,"fire."+ext);
        fread.readAsText(f);
        fread.onloadend = function(){
      		inp.file[fId] = fread.result;
          console.log("DEMO FIRE VAL loaded");
          //start loading the .log file after .val is done loading
          fire.loadFile("log");
        }
        break;
  }
}
// function to be linked to the button
fire.loadFire = function () {
  //start loading the files frim the .ma file
  inp.file = [];
  inp.logLoaded = false;
  inp.logFile = null;
  grid.initialStValues=[];
  fire.loadFile("ma");
}

